import React from 'react';
import './Hero.css';

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>SLAM</h1>
        <h2>LIFESTYLE AND FITNESS STUDIO</h2>
        <h3>SLAM FITNESS STUDIO</h3>
        <p>
          SLAM Fitness is not a gym; it is a way of life.
          Slam Fitness Studio is a premier destination for fitness enthusiasts who seek a results-driven, holistic
          approach to health and wellness. Established in 2009, Slam Fitness redefined the fitness industry in India with
          its innovative programs, cutting-edge facilities, and focus on building a supportive fitness community.
        </p>
      </div>
    </section>
  );
};

export default Hero;
